🇬🇧 In the heart of Helsinki the café Pauligin kulma recently had a little make over. I stopped by to check out the new version. Coffee was good, as always, and this lemon and almond brittle bar was amazing 🤩 

🇫🇮 Kävin kurkkaamassa uudistettua Pauligin kulmaa, Helsingin sydämessä. Kahvi oli hyvää, kuten aina, ja tämä sitruuna-mantelipatukka oli todella herkullinen 🤩

